function load2012RideMap_v3() {
    var query = new google.visualization.Query(
        'http://www.google.com/fusiontables/gvizdata?tq=' + 
        encodeURIComponent("SELECT DateVisited, Location, Coordinates, Title, Url, MarkerIcon FROM 2821659")
    );
    query.send(getResponseData);
}

